import React from "react";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from "./pages/Home/Home";
function App() {
  return <div>
    <Router>
      <Router path="/test" element={<Home />} />
    </Router>
  </div>;
}

export default App;
